import { useState } from "react"

export const useField = (result) => {
  const [value, setValue] = useState("")

	const id = result
	const name = result
	const type = "text"
  const list = "roomates"

  const onChange = (e) => {setValue(e.target.value)}

  return {
		name,
		id,
		type,
    value,
    list,
    onChange
  }
}
